return ['domain'=>NULL,'plural-forms'=>'nplurals=3; plural=(n%10==0 || (n%100>=11 && n%100<=19) ? 0 : n%10==1 && n%100!=11 ? 1 : 2);','language'=>'lv_LV','pot-creation-date'=>'2025-09-04 10:00-0500','po-revision-date'=>'2025-09-04 10:00-0500','translation-revision-date'=>'2025-09-04 10:00-0500','project-id-version'=>'ICS Calendar','x-generator'=>'Poedit 3.7','messages'=>['%1$sYou are running ICS Calendar in a WordPress Playground implementation.%2$s Because ICS Calendar is intended to run on a web server, some features may be unavailable or may not function properly.'=>'%1$sJūs izmantojat ICS kalendāru WordPress spēļu laukuma implementācijā.%2$s Tā kā ICS kalendārs ir paredzēts darbināšanai tīmekļa serverī, dažas funkcijas var būt nepieejamas vai var nedarboties pareizi.','%1$sYour site is currently using a UTC offset-based timezone setting.%2$s This can produce time display errors in the %3$s plugin in locations that observe Daylight Saving Time. Please %4$schange your timezone setting%5$s to the city nearest your location, in the same timezone, for proper time display. See our %6$sdocumentation%7$s for additional information on this issue.'=>'%1$sJūsu vietnē pašlaik tiek izmantots laika joslas iestatījums, kas balstīts uz UTC nobīdi.%2$s Vietās, kur tiek ievērots vasaras laiks, tas var radīt laika rādīšanas kļūdas %3$s spraudnis. Lai laiks tiktu pareizi parādīts, lūdzu, mainiet %4$slaika joslas iestatījumu %5$s uz jums tuvāko pilsētu tajā pašā laika joslā. Papildu informāciju par šo jautājumu skatīt mūsu %6$sdokumentācijā%7$s.','Utilities'=>'Utilītas','Settings'=>'Iestatījumi','User Guide'=>'Lietotāja pamācība','Support'=>'Atbalsts','Upgrade to PRO!'=>'Jauniniet uz PRO!','Show/hide all'=>'Rādīt/paslēpt visu','ICS file could not be retrieved or was empty. Please verify URL is correct, and check your php.ini configuration to verify either cURL or allow_url_fopen is available. If you are using spaces to delimit multiple URLs, you may also wish to try using the pipe character instead. Affected URL:'=>'ICS failu nevarēja izgūt vai tas bija tukšs. Lūdzu, pārbaudiet, vai URL ir pareizs, un pārbaudiet php .ini konfigurāciju, lai pārbaudītu, vai ir pieejams allow_url_fopen vai url. Ja izmantojat atstarpes, lai norobežotu vairākus vietrāžus URL, iespējams, vēlēsieties arī mēģināt izmantot caurules rakstzīmi. Ietekmētais URL:','Hide past events'=>'Paslēpt pagātnes notikumus','Show past events'=>'Rādīt pagātnes notikumus','Contact:'=>'Kontaktpersona:','Resources:'=>'Resursi:','Click for more...'=>'Noklikšķiniet, lai uzzinātu vairāk...','Save to your calendar'=>'Saglabāt kalendārā','Cancelled'=>'Atcelts','The legacy parser option is deprecated and will be removed in a future update.'=>'Vēsturiskā parsera opcija ir novecojusi un tiks noņemta kādā no nākamajiem atjauninājumiem.','The "currentweek" shortcode attribute is deprecated. Please use view="week" in your shortcode instead.'=>'"Currentweek" īsā koda atribūts ir novecojis. Tā vietā, lūdzu, izmantojiet view="week" savā īsajā kodā.','The "legendinline" shortcode attribute is deprecated. Please use legendstyle="inline" in your shortcode instead.'=>'Īsā koda atribūts "legendinline" ir novecojis. Lūdzu, tā vietā īsajā kodā izmantojiet legendstyle="inline".','Cleared %1$s %2$s transient(s).'=>'Notīrīts %1$s %2$s pārejošais(-ie) process(-i).','No %1$s transients were found.'=>'Netika atrasti %1$s pārejas procesi.','Your feed URL appears to contain HTTP Basic Authentication credentials. Try turning off the %1$s option under the %2$s tab above.'=>'Šķiet, ka jūsu plūsmas URL satur HTTP Basic autentifikācijas akreditācijas akreditācijas datus. Mēģiniet izslēgt opciju %1$s, kas atrodas %2$s cilnē iepriekš.','Use legacy feed request method'=>'Izmantot mantoto barības pieprasījuma metodi','%1$sThis URL points to a file in your Media Library.%2$s While you should be able to use this URL in an %3$s shortcode, it will be a static snapshot of the calendar at the time the file was created, and will not reflect any future updates to the source calendar. Please see our %4$sUser Guide%5$s for instructions on obtaining your correct dynamic feed URL.'=>'%1$sŠis URL norāda uz failu jūsu multivides bibliotēkā.%2$s Lai gan jums vajadzētu būt iespējai izmantot šo URL %3$s īsajā kodā, tas būs statisks kalendāra momentuzņēmums brīdī, kad fails tika izveidots, un tas neatspoguļos nekādus turpmākus avota kalendāra atjauninājumus. Lūdzu, skatiet mūsu %4$sLietotāja rokasgrāmatu%5$s, lai saņemtu norādījumus par pareiza dinamiskās plūsmas URL adresāta iegūšanu.','Error: Could not resolve IP address for %1$s.'=>'Kļūda: Nevarēja atrisināt IP adresi %1$s.','Resolved IP address for %1$s:'=>'Atrisināta IP adrese %1$s:','The text entered in the "Default shortcode" field is not a valid shortcode, and was not saved.'=>'Laukā "Noklusējuma īskods" ievadītais teksts nav derīgs īskods, un tas netika saglabāts.','%1$sSettings updated.%2$s You may need to refresh the page to see some changes.'=>'%1$sIestatījumi atjaunināti.%2$s Lai redzētu dažas izmaiņas, jums var būt jāatjauno lapa.','calendar event'=>'kalendāra notikums','The legacy feed request method is deprecated, and will be removed in an update in the near future. Please test your feeds with the legacy feed request method turned off.'=>'Līdzšinējā barošanas pieprasījuma metode ir novecojusi, un tuvākajā laikā tā tiks noņemta kādā no atjauninājumiem. Lūdzu, pārbaudiet savas plūsmas ar izslēgtu veco plūsmas pieprasījuma metodi.','Map'=>'Karte','Recurring event'=>'Periodisks notikums','Recurs every %1$s years'=>'Atkārtojas ik pēc %1$s gadiem','Recurs yearly'=>'Atkārtojas katru gadu','Recurs every %1$s months'=>'Atkārtojas ik pēc %1$s mēnešiem','Recurs monthly'=>'Atkārtojas katru mēnesi','Recurs every %1$s weeks'=>'Atkārtojas ik pēc %1$s nedēļām','Recurs weekly'=>'Atkārtojas katru nedēļu','Recurs every %1$s days'=>'Atkārtojas ik pēc %1$s dienām','Recurs daily'=>'Atkārtojas katru dienu','The "url" property in your %1$s shortcode appears to contain HTML tags; most likely your URL has been turned into a clickable link. Your calendar may not display properly as a result. Please remove the clickable link in the shortcode.'=>'Šķiet, ka jūsu %1$s īskoda īpašība "url" satur HTML tagus; visticamāk, jūsu URL ir pārvērsts par klikšķināmu saiti. Rezultātā jūsu kalendārs var netikt pareizi parādīts. Lūdzu, noņemiet klikšķināmo saiti īsajā kodā.','The r34ics_url_get_contents() function is no longer supported.'=>'Funkcija r34ics_url_get_contents() vairs netiek atbalstīta.','%1$sPlease note:%2$s %3$s version 10.6 changes the default options for several shortcode settings. In order to maintain consistency, these new defaults are %4$snot%5$s enabled when upgrading from an earlier version. If you would like to learn more about the changes please read our %6$sblog post%7$s, or to switch to the new defaults, turn on the %8$s option on the %9$s settings%10$s page.'=>'%1$sLūdzu, ņemiet vērā: %2$s %3$s 10.6 versijā mainītas vairāku īsceļu iestatījumu noklusējuma opcijas. Lai saglabātu konsekvenci, šie jaunie noklusējuma iestatījumi netiek %4$sieslēgti %5$s, ja tiek atjaunināti no iepriekšējās versijas. Ja vēlaties uzzināt vairāk par izmaiņām, lūdzu, izlasiet mūsu %6$sbloga ierakstu%7$s vai, lai pārslēgtos uz jaunajiem noklusējuma iestatījumiem, ieslēdziet %8$s opciju %9$s iestatījumu%10$s lapā.','Use new parameter defaults (v.10.6)'=>'Jaunu parametru noklusējuma iestatījumu izmantošana (v.10.6)','%1$sPlease note:%2$s %3$s version 11.0 streamlines the way ICS feed URLs are retrieved. This change uses a standard built-in WordPress function, so it should be fully compatible with all existing installations. If you encounter any new issues after upgrading to version 11 or later, please visit the %4$sWordPress Support Forums%5$s for assistance.'=>'%1$sLūdzu, ņemiet vērā: %2$s %3$s 11.0 versijā ir racionalizēts veids, kā tiek iegūti ICS barības URL. Šīs izmaiņas izmanto standarta iebūvētu WordPress funkciju, tāpēc tām vajadzētu būt pilnībā saderīgām ar visām esošajām instalācijām. Ja pēc atjaunināšanas līdz 11. vai jaunākajai versijai rodas jaunas problēmas, lūdzu, apmeklējiet %4$sWordPress atbalsta forumus%5$s, lai saņemtu palīdzību.','%1$sPlease note:%2$s %3$s version 11.5.14.2 introduces a new, more secure method for handling calendar parameters when loading via AJAX. Please clear any caching plugins you are using, to ensure that your calendars are loading properly with the new method.'=>'%1$sLūdzu, ņemiet vērā: %2$s %3$s 11.5.14.2 versijā ir ieviesta jauna, drošāka metode kalendāra parametru apstrādei, kad ielādēšana notiek, izmantojot AJAX. Lūdzu, notīriet visus izmantotos kešēšanas spraudņus, lai nodrošinātu, ka kalendāri tiek ielādēti pareizi, izmantojot jauno metodi.','Add %1$s'=>'Pievienot %1$s','Close'=>'Aizvērt','ICS Feed URL:'=>'ICS Feed URL:','Be sure you are using a %1$ssubscribe%2$s URL, not a %3$sweb view%4$s URL.%5$s (Entering the URL directly in your web browser should download an %6$s file.)'=>'Pārliecinieties, ka izmantojat %1$sabonēšanas%2$s URL, nevis %3$stīmekļa skatīšanas%4$s URL%5$s (ievadot URL tieši tīmekļa pārlūkprogrammā, jālejupielādē %6$s fails.)','Calendar Title:'=>'Kalendāra nosaukums:','Leave empty to use calendar&rsquo;s default title. Enter %1$s to omit title altogether.'=>'Atstājiet tukšu, lai izmantotu kalendāra noklusējuma nosaukumu. Ievadiet %1$s, lai vispār izlaistu nosaukumu.','Calendar Description:'=>'Kalendārs Apraksts:','Leave empty to use calendar&rsquo;s default description. Enter %1$s to omit description altogether.'=>'Atstājiet tukšu, lai izmantotu kalendāra noklusējuma aprakstu. Ievadiet %1$s, lai aprakstu vispār neievietotu.','View:'=>'Skats:','month'=>'mēnesis','list'=>'saraksts','week'=>'nedēļa','Count:'=>'Skaitīt:','Format:'=>'Formāts:','Leave %1$s blank to include all upcoming events. %2$s must be a standard %3$sPHP date format string%4$s.'=>'Atstājiet %1$s tukšu, lai iekļautu visus gaidāmos notikumus. %2$s jābūt standarta %3$sPHP datuma formāta virknei%4$s.','Show event descriptions %1$s(change to a number in inserted shortcode to set word limit)%2$s'=>'Rādīt notikumu aprakstus %1$s(mainīt uz numuru ievietotajā īsajā kodā, lai iestatītu vārdu ierobežojumu)%2$s','Show event locations %1$s(if available)%2$s'=>'Rādīt notikumu atrašanās vietas %1$s(ja pieejams)%2$s','Show event organizers %1$s(if available)%2$s'=>'Rādīt notikuma organizatorus %1$s(ja pieejams)%2$s','%1$sNote:%2$s Additional %3$sdisplay options%4$s are available by manually editing the shortcode after insertion.'=>'%1$sPiezīme:%2$s Papildu %3$sdispleja opcijas%4$s ir pieejamas, manuāli rediģējot īso kodu pēc ievietošanas.','Insert %1$s'=>'Ievietot %1$s','Do even more with %1$s!'=>'Ar %1$s varat paveikt vēl vairāk!','Calendar Builder'=>'Kalendāru veidotājs','Configure all calendar settings with an easy visual interface... no need to manually type shortcodes.'=>'Konfigurējiet visus kalendāra iestatījumus, izmantojot vienkāršu vizuālo interfeisu... nav nepieciešams manuāli ievadīt īsceļu kodus.','Additional Views and Enhanced Features'=>'Papildu skati un uzlabotas funkcijas','New ways to display your calendar including Full, Up Next, Masonry, Month with Sidebar, Widget, and more. Additional capabilities are added to the core Month, Basic, List and Week views.'=>'Jauni veidi, kā parādīt kalendāru, tostarp Pilns, Nākamais, Masonry, Mēnesis ar sānu joslu, Logrīks un citi. Galvenajiem Mēneša, Pamata, Saraksta un Nedēļas skatiem ir pievienotas papildu iespējas.','Customizer'=>'Pielāgotājs','Easily modify your calendar color palettes, fonts, and more, site-wide.'=>'Viegli modificējiet kalendāra krāsu paletes, fontus un daudz ko citu vietnes mērogā.','ICS Events'=>'ICS pasākumi','%1$sNew!%2$s Turns %3$s into a full calendar system. Create and manage events directly in WordPress and even integrate them seamlessly with your existing feeds.'=>'%1$sJaunums!%2$s Pārvērš %3$s par pilnu kalendāra sistēmu. Veidojiet un pārvaldiet notikumus tieši WordPress un pat integrējiet tos ar esošajām plūsmām.','Visit %1$s to learn more.'=>'Apmeklējiet %1$s, lai uzzinātu vairāk.','Go PRO!'=>'Ej PRO!','Getting Started'=>'Darba uzsākšana','System Report'=>'Sistēmas atskaite','Save Changes'=>'Saglabāt izmaiņas','Thank you for installing %1$s. Before creating your first calendar shortcode, please visit your %2$sGeneral Settings%3$s page and verify that your site language, timezone and date/time format settings are correct. See our %4$sUser Guide%5$s for more information.'=>'Paldies par instalēšanu %1$s. Pirms izveidojat savu pirmo kalendāra īskodu, lūdzu, apmeklējiet savu %2$sVispārīgie iestatījumi%3$s lapu un pārbaudiet, vai jūsu vietnes valodas, laika joslas un datuma/laika formāta iestatījumi ir pareizi. Lai iegūtu vairāk informācijas, skatiet mūsu %4$sLietotāja rokasgrāmatu%5$s.','Quick Start Guide'=>'Ātrās palaišanas ceļvedis','An extensive %1$sUser Guide%2$s is available on our website. Below are some quick links to key resources in the documentation.'=>'Plaša %1$sLietotāja rokasgrāmata%2$s ir pieejama mūsu tīmekļa vietnē. Zemāk ir dažas īsas saites uz galvenajiem dokumentācijas resursiem.','General:'=>'Vispārīgi:','General WordPress Settings'=>'Vispārīgie WordPress iestatījumi','%1$s Settings'=>'%1$s Iestatījumi','Working with Shortcodes:'=>'Darbs ar īsajām kodēm:','Shortcode Overview'=>'Īsā koda pārskats','Shortcode Builder'=>'Īsā koda konstruktors','Shortcode Parameters Reference'=>'Īsā koda parametru atsauce','Advanced Topics:'=>'Padziļinātas tēmas:','FAQs and Tips'=>'Bieži uzdotie jautājumi un padomi','CSS Guide'=>'CSS ceļvedis','Developer Resources'=>'Izstrādātāju resursi','GDPR'=>'GDPR','Appearance'=>'Izskats','Match calendar color palette to current Block Theme colors'=>'Kalendāra krāsu paletes saskaņošana ar pašreizējā bloka tēmas krāsām','beta'=>'beta','Replaces the %1$s default neutral color palette with nearest matches from the current Site Editor Styles color palette or the %2$s file in your theme. Color selections are algorithmic, and some combinations may not pass accessibility contrast tests. This setting has no effect if you are using a "classic" theme that does not include a %3$s file.'=>'Aizstāj %1$s noklusējuma neitrālo krāsu paleti ar tuvāko krāsu paleti no pašreizējās vietnes redaktora stilu krāsu paletes vai jūsu tēmas %2$s faila. Krāsu izvēle ir algoritmiska, un dažas kombinācijas var neizturēt pieejamības kontrasta testus. Šim iestatījumam nav ietekmes, ja izmantojat "klasisko" tēmu, kurā nav iekļauts %3$s fails.','%1$sThis is currently a beta feature.%2$s It may require making some adjustments to your calendar settings or CSS for optimal display, especially if you have color-coded your feeds. Functionality is subject to change.'=>'%1$sPašlaik šī ir beta versija.%2$s Optimālai attēlošanai var būt nepieciešams veikt dažas korekcijas jūsu kalendāra iestatījumos vai CSS, īpaši, ja jūsu plūsmas ir iekodētas krāsās. Funkcionalitāte var mainīties.','Dark mode'=>'Tumšais režīms','Inverts color palette (light colors on a dark background). %1$sNote:%2$s Dark mode also automatically applies style changes similar to the %3$s and %4$s shortcode parameters, so you do not need to include them in your shortcode.'=>'Inverts krāsu palete (gaišas krāsas uz tumša fona). %1$sPiezīme:%2$s Tumšais režīms arī automātiski piemēro stila izmaiņas, līdzīgi kā %3$s un %4$s īsceļu kodu parametri, tāpēc tie nav jāiekļauj īskodā.','Loading'=>'Notiek ielāde','Always use AJAX to render calendars (recommended)'=>'Kalendāru attēlošanai vienmēr izmantojiet AJAX (ieteicams)','When checked, all calendars will render via AJAX (asynchronously after the page loads). This is especially useful in conjunction with other caching plugins, or if your calendars contain a large number of events. Normally, calendar data is sent directly in the HTML of the initial page load unless AJAX has been specified in the shortcode.'=>'Ja šī opcija ir atzīmēta, visi kalendāri tiks atveidoti, izmantojot AJAX (asinhroni pēc lapas ielādes). Tas ir īpaši noderīgi kopā ar citiem kešēšanas spraudņiem vai tad, ja jūsu kalendāros ir liels skaits notikumu. Parasti kalendāra dati tiek nosūtīti tieši HTML sākotnējās lapas ielādes laikā, ja vien īsajā kodā nav norādīts AJAX.','Increase memory limit when rendering calendars'=>'Atmiņas ierobežojuma palielināšana, atveidojot kalendārus','If your calendar is failing to load with an "out of memory" fatal error, try increasing the memory limit. A minimum of 512 MB is recommended. %1$s Notes: 1) Some hosting providers may not allow applications to override the server default setting. 2) It is not possible to set this option lower than the current default memory limit on your server.'=>'Ja kalendāru neizdodas ielādēt ar fatālu kļūdu "nav atmiņas", mēģiniet palielināt atmiņas limitu. Ieteicams vismaz 512 MB. %1$s Piezīmes: 1) Daži hostinga pakalpojumu sniedzēji var neļaut lietojumprogrammām mainīt servera noklusējuma iestatījumu. 2) Šo opciju nav iespējams iestatīt zemāku par pašreizējo noklusējuma atmiņas limitu jūsu serverī.','deprecated'=>'novecojis','If your site has stopped retrieving feeds after the version 11 update, turn on this option to use the legacy request method. This feature is deprecated and will be removed in an update in the near future.'=>'Ja pēc 11. versijas atjauninājuma jūsu vietne ir pārstājusi iegūt plūsmas, ieslēdziet šo opciju, lai izmantotu veco pieprasījuma metodi. Šī funkcija ir novecojusi, un tuvākajā laikā atjauninājumā tā tiks noņemta.','Default shortcode'=>'Noklusējuma īskods','If your site will include a large number of similarly configured calendar shortcodes, you can enter a default "base" shortcode here with the parameters that should be the same for all of the calendars. Individual shortcodes on the site can then include only the parameters that are unique to that calendar, as such: %1$s Any parameters included in the individual shortcode will override what is set here.'=>'Ja jūsu vietnē būs iekļauts liels skaits līdzīgi konfigurētu kalendāra saīsnes kodu, šeit varat ievadīt noklusējuma "bāzes" saīsnes kodu ar parametriem, kam jābūt vienādiem visiem kalendāriem. Atsevišķi saīsinātie kodi vietnē pēc tam var ietvert tikai tos parametrus, kas ir unikāli attiecīgajam kalendāram kā tādam: %1$s Jebkuri parametri, kas iekļauti atsevišķā īsajā kodā, atceļ šeit iestatītos.','Allow access to these hostnames that resolve to reserved IP addresses'=>'Atļaut piekļuvi šiem resursnosaukumiem, kas atrisina rezervētās IP adreses','If your calendar server is hosted on the same physical server as your website, is part of the same local network, or otherwise uses a %1$sreserved IP address%2$s, enter its hostname here to allow access. For multiple calendar servers, enter one hostname per line. See %3$sthe %4$s documentation%5$s for more information.'=>'Ja jūsu kalendāra serveris ir izvietots tajā pašā fiziskajā serverī, kurā atrodas jūsu vietne, ir daļa no tā paša vietējā tīkla vai citādi izmanto %1$srezervētu IP adresi%2$s, ievadiet šeit tā uzņēmēja nosaukumu, lai atļautu piekļuvi. Ja ir vairāki kalendāra serveri, katrā rindā ievadiet vienu saimniekvārdu. Lai iegūtu vairāk informācijas, skatiet %3$sdokumentāciju %4$s%5$s.','Enter one hostname per line. Hostnames are the base domain name, not a full URL. %1$s For example, you would enter %2$s, not %3$s.'=>'Katrā rindā ievadiet vienu viesvietas nosaukumu. Uzņēmēja vārds ir pamatdomēna vārds, nevis pilns URL. %1$s Piemēram, ievadiet %2$s, nevis %3$s.','Caching'=>'Kešatmiņa','Transient (cache) expiration'=>'Pārejas (kešatmiņas) derīguma termiņa beigas','seconds'=>'sekundes','Sets how long calendar feed data should be cached on the server (WordPress transients) before reloading. Default is 3600 (1 hour).'=>'Iestatīts, cik ilgi kalendāra padeves dati pirms atkārtotas ielādēšanas jāielādē serverī (WordPress pārejas). Noklusējuma iestatījums ir 3600 (1 stunda).','Miscellaneous'=>'Dažādi','Remove "Add ICS Calendar" button in Classic Editor'=>'Dzēst pogu "Pievienot ICS kalendāru" klasiskajā redaktorā','By default, ICS Calendar adds an "Add ICS Calendar" button to the toolbar above the WYSIWYG editor when using Classic Editor. Check this box to remove the button. Has no effect on sites using the Block Editor (Gutenberg).'=>'Pēc noklusējuma ICS kalendārs rīku joslai virs WYSIWYG redaktora pievieno pogu "Pievienot ICS kalendāru", ja tiek izmantots klasiskais redaktors. Atzīmējiet šo rūtiņu, lai šo pogu noņemtu. Nav ietekmes uz vietnēm, kurās tiek izmantots bloka redaktors (Gutenberg).','%1$s version 10.6 introduced new default values for several shortcode parameters. New installations automatically use the new default values, but upgraded installations will continue to use the old default values, unless this box is checked. Read more about these changes on %2$sour blog%3$s.'=>'%1$s 10.6 versijā ieviestas jaunas noklusējuma vērtības vairākiem īskodu parametriem. Jaunās instalācijas automātiski izmanto jaunās noklusējuma vērtības, bet atjauninātās instalācijas turpinās izmantot vecās noklusējuma vērtības, ja vien šis lodziņš nav atzīmēts. Vairāk par šīm izmaiņām lasiet %2$smūsu blogā %3$s.','Our complete user guide is available with full translation into dozens of languages on our website:'=>'Pilnīga lietotāja rokasgrāmata ar pilnu tulkojumu vairākās valodās ir pieejama mūsu vietnē:','For assistance, please use our %1$ssupport request form%2$s.'=>'Lai saņemtu palīdzību, lūdzu, izmantojiet mūsu %1$satbalsta pieprasījuma veidlapu%2$s.','When contacting support, please include the %1$sSystem Report%2$s from this page.'=>'Sazinoties ar atbalsta dienestu, lūdzu, norādiet %1$sSistēmas ziņojums%2$s no šīs lapas.','Spread the word!'=>'Izplatiet šo informāciju!','If you find %1$s useful, you can help support our continued growth and development with a %2$sfive-star review%3$s. Thank you!'=>'Ja jums %1$s ir noderīgs, varat palīdzēt atbalstīt mūsu nepārtrauktu izaugsmi un attīstību ar %2$spiecu zvaigžņu atsauksmi%3$s. Paldies!','%1$s Data Cache'=>'%1$s Datu kešatmiņa','Clear Cached Calendar Data'=>'Notīrīt kešotos kalendāra datus','This will immediately clear all existing cached calendar data (purge transients), forcing WordPress to reload all calendars the next time they are viewed. Caching will then resume as before.'=>'Tas nekavējoties nodzēsīs visus esošos kešatmiņā saglabātos kalendāra datus (iztīriet pagaidu datus), liekot WordPress pārlādēt visus kalendārus nākamajā skatīšanas reizē. Kešdarīšana pēc tam atsāksies kā līdz šim.','ICS Feed URL Tester'=>'ICS plūsmas URL testētājs','If you are concerned that the plugin is not properly retrieving your feed, you can test the URL here.'=>'Ja uztraucaties, ka spraudnis nepareizi izgūst plūsmu, varat pārbaudīt vietrādi URL šeit. Spraudņa saņemtie izejas dati tiks parādīti zemāk.','Enter feed URL...'=>'Ievadiet plūsmas URL...','Test URL'=>'Testa URL','Results:'=>'Rezultāti:','%1$s received.'=>'%1$s saņemts.','This appears to be a valid ICS feed URL.'=>'Šķiet, ka šis ir derīgs ICS barības URL.','This does not appear to be a valid ICS feed URL.'=>'Šķiet, ka šis nav derīgs ICS barības URL.','Could not retrieve data from the requested URL.'=>'Nevarēja izgūt datus no pieprasītā URL.','An unknown error occurred while attempting to retrieve the requested URL.'=>'Mēģinot izgūt pieprasīto URL, radās nezināma kļūda.','Please copy the following text and include it in your message when emailing support.'=>'Lūdzu, nokopējiet šo tekstu un iekļaujiet to savā ziņojumā, nosūtot e-pasta ziņojumu atbalsta dienestu.','Also please include the %1$s shortcode exactly as you have it entered on the affected page.'=>'Lūdzu, iekļaujiet arī %1$s īso kodu tieši tā, kā tas ir ievadīts attiecīgajā lapā.','For your site security please do NOT post the System Report in the support forums.'=>'Lai nodrošinātu vietnes drošību, lūdzu, NEIEKĻAUJIET sistēmas ziņojumu atbalsta forumos.','No events found.'=>'Nav atrasts neviens notikums.','Previous Page'=>'Iepriekšējā lappuse','Next Page'=>'Nākamā lapa','All Day'=>'Visu dienu','Today'=>'Šodien','No events.'=>'Nav notikumu.','No additional events this month.'=>'Šomēnes nav papildu notikumu.','Last week'=>'Viņnedēļ','This week'=>'Šonedēļ','Next week'=>'Nākamā nedēļa','ICS Calendar'=>'ICS Calendar','https://icscalendar.com'=>'https://icscalendar.com','Turn your Google Calendar, Microsoft Office 365 or Apple iCloud Calendar into a seamlessly integrated, auto-updating, zero-maintenance WordPress experience.'=>'Pārvērsiet savu Google kalendāru, Microsoft Office 365 vai Apple iCloud kalendāru bez problēmām integrētā, automātiski atjaunināmā un bezaprūpes WordPress lietojumprogrammā.','Room 34 Creative Services, LLC'=>'Room 34 Creative Services, LLC']];
